import React from "react";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Header from "./Header.js";
// import Home from "./Home.js";
// import Checkout from "./Checkout.js";
// import "./App.css";

function App() {
  return (
    <>
      <BrowserRouter>
        <div className="app">
          <Header />
          <Switch>
            <Route exact path="/">
              <Home />
            </Route>
            <Route path="/checkout">
              <Checkout />
            </Route>
            <Route path="/cart">
              <h2>cart page</h2>
            </Route>
          </Switch>
        </div>
      </BrowserRouter>
    </>
  );
}
export default App;
